# Do a simple sanity check. Only the floats should differ and only by a small
# value. So we convert each to an integer, by removing any decimal point and
# flagging up any difference greater than 3.
for a, b in _xtranslate.iteritems():
    diffs = []
    for aa, bb in zip(a.split(), b.split()):
        if aa == bb:
            continue
        if "." not in aa or "." not in bb:
            diffs.append((aa, bb))
            continue
        iaa = int(aa.replace(".", ""))
        ibb = int(bb.replace(".", ""))
        if abs(iaa - ibb) > 3:
            diffs.append((aa, bb))

    if diffs:
        print >>sys.stderr, "Big Diff", diffs
        print >>sys.stderr, "  ", a
        print >>sys.stderr, "  ", b
